import React from 'react';

function DeleteQues({quesId, quesNo, quesText, handleSelection})
{
    return(
        <tr>
            <td><input type='checkbox' value={quesId} onChange={(e)=>handleSelection(e, e.target.value)}/></td>
            <td>{quesNo}</td>
            <td>{quesText}</td>
        </tr>
    );

}
export default DeleteQues;
